import React from "react";
import "../App.css";
import human from "./khylecv24.jpg";

function Resume() {

    const styles =  {
            margin: "auto",
            width: "50%",
            border: "3px solid #73AD21",
            padding: "10px"
        }
        
        return (
            <div id="resume" style={styles} className="RES">
            <img src={human} alt="resume" />
        </div>
    );
}

export default Resume;
